import './TicTac.css'
import akr from '../Assets/akr.png'
import him from '../Assets/him.png'
import { useState } from 'react'

let data = ['', '', '', '', '', '', '', '', '']

const TicTac = () => {
	let [count, setCount] = useState(0)
	let [lock, setLock] = useState(false)
	const toggle = (e, num) => {
		if (lock) {
			return 0
		}
		if (count % 2 === 0) {
			e.target.innerHTML = `<img src='${akr}'  />`
			data[num] = 'x'
			setCount(++count)
		} else {
			e.target.innerHTML = `<img src='${him}'  />`
			data[num] = 'o'
			setCount(++count)
		}
	}
	return (
		<div className='container'>
			<h1 className='title'>
				Tic Tac Game In <span>React</span>
			</h1>
			<div className='board'>
				<div className='row1'>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 0)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 1)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 2)
						}}
					></div>
				</div>
				<div className='row2'>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 3)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 4)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 5)
						}}
					></div>
				</div>
				<div className='row3'>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 6)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 7)
						}}
					></div>
					<div
						className='boxes'
						onClick={e => {
							toggle(e, 8)
						}}
					></div>
				</div>
			</div>
			<button className='reset'>Reset</button>
		</div>
	)
}

export default TicTac
